import { Button, Container, Row, Col, Form } from "react-bootstrap";

import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div>
      <Container>
        <Row>
          <Col xs={6}><Login className = "login" /></Col>
          <Col xs={6}><Register className = "register"/></Col>
        </Row>
      </Container>


      <Footer />
    </div>
  );
}

export default App;
